import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';

const AdminLayout = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        {/* Sidebar */}
        <div className="col-md-3">
          <Sidebar />
        </div>
        
        {/* Main Content */}
        <div className="col-md-9">
          <Header />
          <div className="container-fluid">
            {/* Nội dung có thể thêm vào đây */}
            <div className="p-3">
              <h4>Dashboard Content</h4>
              <p>This is where the main content for the dashboard will be displayed.</p>
            </div>
            <div className="p-3">
              <h4>User Group Content</h4>
              <p>This is where the user group content will be displayed.</p>
            </div>
            <div className="p-3">
              <h4>Messages Content</h4>
              <p>This is where the messages content will be displayed.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminLayout;
